import React from 'react';
import Routes from './routes';
import './App.css';
import carrinho from './assets/carrinho.svg';

function App() {
    return (
        <>
            <div className="menu">
                Celulares
                <div>
                    <img src={carrinho} alt="Carrinho de compras" />
                </div>
            </div>
            <div className="container">
                <div className="content">
                    <Routes />
                </div>
            </div>
        </>
    );
}

export default App;
